import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import ProductList from './components/ProductList';
import ProductForm from './components/ProductForm';
import ProductDetail from './components/ProductDetail';
import ProductDelete from './components/ProductDelete';

function App() {
    return (
        <Router>
            <Switch>
                <Route exact path="/productos" component={ProductList} />
                <Route exact path="/productos/nuevo" component={ProductForm} />
                <Route exact path="/productos/:id" component={ProductDetail} />
                <Route exact path="/productos/:id/editar" component={ProductForm} />
                <Route exact path="/productos/:id/eliminar" component={ProductDelete} />
            </Switch>
        </Router>
    );
}

export default App;
